import React from 'react';

const Nav = ({ onRouteChange }) => {
    return (
        <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
            <p onClick={() => onRouteChange()} className='f3 dim link white underline pa3 pointer'>About Me</p>
            <p onClick={() => onRouteChange()} className='f3 dim link white underline pa3 pointer'>Education</p>
            <p onClick={() => onRouteChange()} className='f3 dim link white underline pa3 pointer'>Work</p>
        </nav>
    )
}

export default Nav;
